import React from 'react';
import ReactDOM from 'react-dom';
import Di from './Component/Di.js';
import './App.css';
import Flight_result from './Component/Flight_result.js';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { browserHistory } from 'react-router';


class App extends React.Component {
constructor(props){
super(props)
this.state={
flights:[]
}
}

getdata=(data)=>{
this.setState({flights:data})
}

 render(){
 return (
    <Router>
    <div>
    <Di getd={this.getdata}/>
     <Switch>
     <Route exact path="/" component={Di} />
     <Route path="/Results" component={(props)=><Flight_result {...props} flights={this.state.flights} />} />
      </Switch>
     </div>
    </Router>
     );
   }
}

export default App;
